<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>Bienvenue dans ce tutoriel consacré à la présentation du processus de création d'un <b>Jeu de Super Mario Bros</b> en <b>C++</b> avec <b>Qt 6</b> sous <b>Windows</b>. Nous utiliserons la bibliothèque de création d'interfaces homme machine Qt en C++ sous Windows. Nous utiliserons le compilateur (MinGW) pour compiler notre projet Qt. Qt fournit un environnement de développement intégré (Qt Creator) et un designer d'interfaces graphiques (Qt Designer), un assistant d'aide (Qt Assistant) et un moyen d'internationalisation de nos projets vers plusieurs langues de notre choix (Qt Translation). Nous sommes libres d'utiliser un éditeur de code de notre choix (Eclipse, VS Code ou Microsoft Visual Studio) pour éditer nos fichiers sources puis passer en ligne de commande pour construire, compiler et déboguer notre projet Qt, d'ailleurs, c'est cette solution que nous utiliserons dans notre projet pour plus de flexibilité, même si Qt fournit tout l'écosystème pour faire bien plus de choses que ça. Nous utiliserons le fichier projet (*.pro) pour construire notre projet Qt. Tout le long du développement, nous nous efforcerons à respecter les bonnes pratiques en ingénierie logiciel. Nous veillerons à respecter les principes SOLID pour faciliter la compréhension du code ainsi que sa maintenance et son évolution, les principes RAII pour faciliter la gestion de nos ressources en considérant l'acquisition d'une ressource comme une initialisation afin d'éviter les fuites de mémoire et profiter pleinement du destructeur automatique de classe lorsqu'un objet sort de sa portée, les principes DRY pour éviter la duplication de base de code et nous nous interdirons de créer des objets incomplets.<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="fichier-projet">Fichier Projet</a>
</h1>
<div class="Section6"><br>Le fichier projet (*.pro) est l'une des techniques utilisées par Qt pour construire un projet via la commande (qmake).<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_declaration-de-la-cible">Déclaration de la cible</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_declaration-des-repertoires-de-construction">Déclaration des répertoires de construction</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_declaration-des-ressources">Déclaration des ressources</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_declaration-des-sources-c--">Déclaration des sources C++</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_declaration-des-entetes-c--">Déclaration des entêtes C++</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_activation-de-la-console">Activation de la console</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_activation-des-standards-c--">Activation des standards C++</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fichier-projet_note-sur-le-compilateur-des-meta-objets">Note sur le compilateur des méta-objets</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_declaration-de-la-cible" href="#fichier-projet">Déclaration de la cible</a>
</h2><br>La cible du projet est un fichier exécutable (rdv_super_mario_bros.exe). Nous indiquons la cible à Qt en affectant le nom du fichier exécutable (rdv_super_mario_bros) à la variable (TARGET). Nous indiquons à Qt que la cible est un fichier exécutable en affectant la valeur (app) à la variable (TEMPLATE).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_declaration-des-repertoires-de-construction" href="#fichier-projet">Déclaration des répertoires de construction</a>
</h2><br>Par défaut, Qt génère chaque construction de projet dans un dossier (Debug) ou (Release). Les fichiers intermédiaires tels que les fichiers objet (*.o) et autres fichiers tels que les fichiers MOC (*.moc) ainsi les fichiers cibles (*.exe ou *.lib ou *.dll) sont placés dans ce dossier. La bonne nouvelle c'est que nous pouvons contrôler les répertoires de génération de ces fichiers. Nous indiquons à Qt de générer le fichier exécutable dans le répertoire binaire en affectant la valeur (bin) à la variable (DESTDIR). Nous indiquons à Qt de générer les fichiers objet (*.o) dans le répertoire build en affectant la valeur (build) à la variable (OBJECTS_DIR). Nous indiquons à Qt de générer les fichiers MOC (*.moc) dans le répertoire build en affectant la valeur (build) à la variable (MOC_DIR). Nous indiquons à Qt de générer les fichiers interface utilisateur UI (ui_*.h) dans le répertoire build en affectant la valeur (build) à la variable (UI_DIR). Nous indiquons à Qt de générer les fichiers ressource RCC (rcc_*.h) dans le répertoire build en affectant la valeur (build) à la variable (RCC_DIR).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_declaration-des-ressources" href="#fichier-projet">Déclaration des ressources</a>
</h2><br>Le compilateur de ressources (RCC) est utilisé pour intégrer des ressources dans une application Qt pendant le processus de construction. Il fonctionne en générant un fichier source C++ contenant des données spécifiées dans un fichier de ressources Qt (*.qrc). Nous indiquons l'utilisation d'une ressource à Qt en ajoutant le nom du fichier ressource (resources.qrc) à la variable (RESOURCES).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_declaration-des-sources-c--" href="#fichier-projet">Déclaration des sources C++</a>
</h2><br>Les sources C++ du projet contiennent les définitions de la logique métier à laquelle doit répondre le projet. Nous indiquons les sources C++ de notre projet à Qt en affectant l'ensemble des sources (main.cpp source.cpp) à la variable (SOURCES).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_declaration-des-entetes-c--" href="#fichier-projet">Déclaration des entêtes C++</a>
</h2><br>Les en-têtes C++ du projet contiennent les déclarations de la logique métier à laquelle doit répondre le projet. Nous indiquons les en-têtes C++ de notre projet à Qt en affectant l'ensemble des sources (header1.h header2.h) à la variable (HEADERS). La déclaration d'un fichier d'en-tête C++ est obligatoire lorsqu'il contient la macro (Q_OBJECT) permettant de bénéficier du mécanisme des signaux et des slots.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_activation-de-la-console" href="#fichier-projet">Activation de la console</a>
</h2><br>Le débogage permet d'afficher des informations sur les données internes du projet à l'écran afin de saisir très rapidement le sens réel des données. Qt étant orienté pour la création d'interfaces utilisateur, par défaut, l'affichage des données à l'écran est inhibé. Nous indiquons à Qt d'activer l'affichage des données à l'écran en ajoutant la valeur (console) à la variable (CONFIG). Nous affichons un message de débogage à l'écran en avec la macro (qDebug). Nous affichons un message d'erreur fatale avec la variable (qFatal).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_activation-des-standards-c--" href="#fichier-projet">Activation des standards C++</a>
</h2><br>Les standards C++ sont devenus incontournable de nos jours si nous voulons bénéficier de toutes la puissance du langage C++ dans notre projet. Nous indiquons à Qt d'utiliser les standards C++ de décembre 2017 lors de la compilation de notre projet en ajoutant la valeur (c++17) à la variable (QMAKE_CXXFLAGS).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fichier-projet_note-sur-le-compilateur-des-meta-objets" href="#fichier-projet">Note sur le compilateur des méta-objets</a>
</h2><br>Le compilateur des méta-objets (MOC) lit un fichier d'en-tête C++. S'il trouve une ou plusieurs déclarations de classe contenant la macro (Q_OBJECT), il produit un fichier source C++ contenant le code méta-objet de ces classes. Le système de méta-objets de Qt fournit le mécanisme de signaux et de slots pour la communication inter-objets, les informations de type d'exécution et le système de propriétés dynamiques.&nbsp;<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="messages-de-debogage">Messages de débogage</a>
</h1>
<div class="Section6"><br>Les messages de débogage servent à remonter des informations sur les données internes de l'application.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#messages-de-debogage_messages-de-debogage">Messages de débogage</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#messages-de-debogage_messages-d-erreur">Messages d'erreur</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="messages-de-debogage_messages-de-debogage" href="#messages-de-debogage">Messages de débogage</a>
</h2><br>Nous utilisons la macro (qDebug) pour afficher les messages de débogages. Les messages de débogage de type (qDebug) laissent continuer l'exécution de l'application.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="messages-de-debogage_messages-d-erreur" href="#messages-de-debogage">Messages d'erreur</a>
</h2><br>Nous utilisons la macro (qFatal) pour afficher les messages d'erreurs à l'écran. Les messages de type (qFatal) arrêtent l'exécution de l'application.&nbsp;<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="ecran-d-accueil">Ecran d'accueil</a>
</h1>
<div class="Section6"><br>L'écran d'accueil permet d'afficher une image dans une fenêtre d'accueil (sans barre de titre) au lancement de l'application. Nous utilisons la classe (QSplashscreen) pour créer l'écran d'accueil. Nous utilisons la classe (QPixmap) pour charger l'image d'accueil. Nous utilisons dans la classe (QTimer), la méthode statique (singleShot) pour marquer un délai d'attente (200ms) pendant lequel l'écran d'accueil restera affiché. Nous nous servons de la méthode statique (singleShot) de la classe (QTimer) pour connecter le slot de fermeture (close) de l'écran d'accueil au signal associé à l'expiration du délai d'attente (timeout) de la classe (QTimer).<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="fenetre-principale">Fenêtre principale</a>
</h1>
<div class="Section6"><br>La fenêtre principale correspond à l'interface graphique de notre application. La fenêtre principale est une classe qui dérive de la classe (QMainWindow). Une fenêtre principale (QMainWindow) est une fenêtre qui possède une barre de titre, une barre de menu, une barre d'outils, un composant graphique centrale et une barre d'états.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fenetre-principale_affichage-de-la-fenetre-principale">Affichage de la fenêtre principale</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fenetre-principale_titre-de-l-application">Titre de l'application</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fenetre-principale_icone-de-l-application">Icône de l'application</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fenetre-principale_actions-de-l-application">Actions de l'application</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fenetre-principale_menus-de-l-application">Menus de l'application</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fenetre-principale_centrage-de-la-fenetre-principale">Centrage de la fenêtre principale</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#fenetre-principale_fermeture-de-l-application">Fermeture de l'application</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fenetre-principale_affichage-de-la-fenetre-principale" href="#fenetre-principale">Affichage de la fenêtre principale</a>
</h2><br>Nous nous servons de la méthode statique (singleShot) de la classe (QTimer) pour connecter le slot d'affichage (show) de la fenêtre principale au signal associé à l'expiration du délai d'attente (timeout) de classe (QTimer). Ainsi, la fermeture de l'écran d'accueil annonce l'affichage de la fenêtre principale.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fenetre-principale_titre-de-l-application" href="#fenetre-principale">Titre de l'application</a>
</h2><br>Nous initialisons le titre de notre application avec la méthode (setWindowTitle) présente dans la classe (QMainWindow).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fenetre-principale_icone-de-l-application" href="#fenetre-principale">Icône de l'application</a>
</h2><br>Nous initialisons l'icône de notre application avec la méthode (setWindowIcon) présente dans la classe (QApplication).&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fenetre-principale_actions-de-l-application" href="#fenetre-principale">Actions de l'application</a>
</h2><br>Nous créons une action avec la classe (QAction). Nous initialisons le libellé de l'action (QAction) avec la méthode (setText). Nous initialisons le raccourci clavier associé à l'action avec la méthode (setShortcut). Nous initialisons le message de la barre de statut associé à l'action avec la méthode (setStatusTip). Nous récupérons l'évènement provenant d'une action en connectant le signal (triggered) de l'action au slot (customSlot) de la fenêtre principale.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fenetre-principale_menus-de-l-application" href="#fenetre-principale">Menus de l'application</a>
</h2><br>Nous récupérons la barre de menu (QMenuBar) avec la méthode (menuBar) de la classe (QMainWindow). Nous ajoutons un menu (QMenu) à la barre de menu (QMenuBar) avec la méthode (addMenu) de classe (QMenuBar) en précisant le texte libellé du menu (File).
Nous créons un menu avec la classe (QAction). Nous ajoutons une action (QAction) à un menu (QMenu) avec la méthode (addAction) de la classe (QMenu).&nbsp;&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fenetre-principale_centrage-de-la-fenetre-principale" href="#fenetre-principale">Centrage de la fenêtre principale</a>
</h2><br>Le centrage de la fenêtre principale consiste à fixer les dimensions de la fenêtre principale et à positionner la fenêtre principale au centre de l'écran de l'ordinateur. Nous fixons les dimensions de la fenêtre principale (1280 x 720) avec la méthode (setFixedSize) de la classe (QMainWindow). Nous récupérons les dimensions de l'écran de l'ordinateur à partir de la méthode (geometry) de la classe (QScreen). Nous récupérons l'objet (QScreen) correspond à l'écran de l'ordinateur avec la méthode statique (primaryScreen) de la classe (QApplication). Nous calculons les positions de centrage de la fenêtre principale (Xc , Yc) à partir des dimensions de la fenêtre principale et de celles de l'écran de l'ordinateur. Nous déplaçons la fenêtre principale au centre de l'écran de l'ordinateur avec la méthode (move) de la classe (QMainWindow).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="fenetre-principale_fermeture-de-l-application" href="#fenetre-principale">Fermeture de l'application</a>
</h2><br>Nous réalisons la fermeture de l'application en connectant le signal (triggered) de l'action (quitAction) au slot (close) de la fenêtre principale (QMainWindow).&nbsp;&nbsp;<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="vue-graphique-principale">Vue graphique principale</a>
</h1>
<div class="Section6"><br>La vue graphique principale correspond au composant graphique central de la fenêtre principale. Elle dérive de la classe (QGraphicsView). Nous initialisons la vue graphique principale comme étant le composant graphique central de la fenêtre principale avec la méthode (setCentralWidget) de la classe (QMainWIndow). Nous initialisons les dimensions de la vue graphique principale (1280 x 720) avec la méthode (setFixedSize) de la classe (QGraphicsView). Nous désactivons la barre de défilement horizontal de la vue graphique principale avec la méthode (setHorizontalScrollBarPolicy) de la classe (QGraphicsView). Nous désactivons la barre de défilement horizontal de la vue graphique principale avec la méthode (setVerticalScrollBarPolicy) de la classe (QGraphicsView). Une vue graphique  (QGraphicsView) est un containeur de scène graphique (QGraphicsScene). Nous initialisons une scène graphique dans la vue graphique principale avec la méthode (setScene) de la classe (QGraphicsView).<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="scene-graphique-du-titre">Scène graphique du titre</a>
</h1>
<div class="Section6"><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#scene-graphique-du-titre_creation-du-decor">Création du décor</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#scene-graphique-du-titre_animation-de-l-image-de-fond">Animation de l'image de fond</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="scene-graphique-du-titre_creation-du-decor" href="#scene-graphique-du-titre">Création du décor</a>
</h2><br>La scène graphique du titre dérive de la classe (QGraphicsScene) et est constituée d'un empilement de 3 images:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une image de fond constitué d'une couleur de fond bleu ciel avec des nuages.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une image de sol constitué d'un sol avec de la verdure.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Une image de titre constitué de l'image d'accueil de Super Mario Bros.</div>
</div><br>Nous créons une image pouvant être ajoutée à une scène graphique (QGraphicsScene) en utilisant la classe (QGraphicsPixmapItem). Nous ajoutons une image (QGraphicsPixmapItem) à une scène graphique avec la méthode (addItem) de la classe (QGraphicsScene). Nous définissons le rectangle de la scène avec la méthode (setSceneRect) de la classe (QGraphicsScene).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="scene-graphique-du-titre_animation-de-l-image-de-fond" href="#scene-graphique-du-titre">Animation de l'image de fond</a>
</h2><br>Nous animons l'image de fond afin d'avoir un ciel avec une couleur de fond bleu ciel et des nuages en mouvement. Afin de pouvoir créer une image capable d'être animée:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous créons une classe qui dérive de la classe (QObject) afin de modifier le propriété position de l'image et la classe (QGraphicsPixmapItem) afin d'ajouter l'image à une scène graphique.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Nous créons une animation avec la classe (QPropertyAnimation) associée à la position de l'image. Nous définissons un nombre illimité de boucles d'animation avec la méthode (setLoopCount). Nous définissons la durée de l'animation (150 000 ms) avec la méthode (setDuration). Nous définissons la position de départ de l'image (-1280 , 0) avec la méthode (setStartValue). Nous définissons la position de fin de l'image (0, 0) avec la méthode (setEndValue).<br></div>
</div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="gestion-des-utilisateurs">Gestion des utilisateurs</a>
</h1>
<div class="Section6"><br>La gestion des utilisateurs nous permet d'identifier chaque joueur afin d'enregistrer le contexte de chaque session de jeu. Un utilisateur est identifié à travers son nom d'utilisateur et son mot de passe. L'utilisateur doit d'abord créer un compte et ensuite se connecter avant d'accéder au jeu.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_interface-de-gestion-des-utilisateurs">Interface de gestion des utilisateurs</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_zone-de-texte">Zone de texte</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_zone-de-texte--mot-de-passe-">Zone de texte (mot de passe)</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_libelle">Libellé</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
