<a class="Summary6" href="#gestion-des-utilisateurs_bouton-connexion-invite">Bouton connexion invité</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_bouton-nouvel-utilisateur">Bouton nouvel utilisateur</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_boite-de-dialogue--saisie-d-un-nouvel-utilisateur-">Boîte de dialogue (saisie d'un nouvel utilisateur)</a>
