<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_expression-reguliere">Expression régulière</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_expression-reguliere">Expression régulière</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-utilisateurs_base-de-donnees">Base de données</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_interface-de-gestion-des-utilisateurs" href="#gestion-des-utilisateurs">Interface de gestion des utilisateurs</a>
</h2><br>L'interface de gestion des utilisateurs est créée directement dans la vue graphique principale (QGraphicsView) pour faciliter la connexion de l'utilisateur à la scène graphique de jeu (QGraphicsScene). Nous réalisons cela au moment de la création de chaque composant graphique de l'interface de gestion des utilisateurs en indiquant que le parent est la vue graphique principale (QGraphicsView). L'interface de gestion des utilisateurs est constituée d'une combinaison des composants graphiques suivants : des libellés, des zones de texte, des boutons et une option.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_zone-de-texte" href="#gestion-des-utilisateurs">Zone de texte</a>
</h2><br>Une zone de texte permet de saisir un texte. Nous créons une zone de texte avec la classe (QLineEdit). Nous initialisons le nom de l'objet de la zone de texte avec la méthode (setObjectName). Nous initialisons l'infobulle de la zone de texte avec la méthode (setToolTip). Nous initialisons la géométrie de la zone de texte, c'est-à-dire, sa position et ses dimensions avec la méthode (setGeometry). Nous affichons une image dans un libellé avec la méthode (setPixmap). Nous masquons la zone de texte avec la méthode (close).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_zone-de-texte--mot-de-passe-" href="#gestion-des-utilisateurs">Zone de texte (mot de passe)</a>
</h2><br>Lors de la saisie du mot de passe dans la zone de texte (QLineEdit) nous proposons une option (QRadioButton) qui nous permet de masquer ou d'afficher le mot de passe. Nous modifions le mode d'affichage du mot de passe avec la méthode (setEchoMode) de la classe (QLineEdit).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_libelle" href="#gestion-des-utilisateurs">Libellé</a>
</h2><br>Un libellé permet de mieux identifier une zone de texte. Nous créons un libellé avec la classe (QLabel). Nous modifions la police du libellé avec la méthode (setFont). Nous initialisons le texte du libellé avec la méthode (setText). Nous initialisons la géométrie du libellé, c'est-à-dire, sa position et ses dimensions avec la méthode (setGeometry). Nous initialisons le nom de l'objet du libellé avec la méthode (setObjectName).&nbsp;Nous masquons le libellé avec la méthode (close).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_option" href="#gestion-des-utilisateurs">Option</a>
</h2><br>Une option permet de réaliser un choix parmi plusieurs. Nous créons une option avec la classe (QRadioButton). Nous initialisons le texte de l'option avec la méthode (setText). Nous initialisons l'infobulle de l'option avec la méthode (setToolTip). Nous initialisons la géométrie de l'option, c'est-à-dire, sa position et ses dimensions avec la méthode (setGeometry). Nous connectons l'option à une action avec la méthode (connect).&nbsp;Nous masquons l'option avec la méthode (close).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_bouton" href="#gestion-des-utilisateurs">Bouton</a>
</h2><br>Un bouton permet de réaliser une action. Nous créons un bouton avec la classe (QPushButton). Nous initialisons le texte du bouton avec la méthode (setText). Nous initialisons l'infobulle du bouton avec la méthode (setToolTip). Nous initialisons la géométrie du bouton, c'est-à-dire, sa position et ses dimensions avec la méthode (setGeometry). Nous connectons le bouton à une action avec la méthode (connect).&nbsp;Nous masquons le bouton avec la méthode (close).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_police" href="#gestion-des-utilisateurs">Police</a>
</h2><br>Une police permet de modifier la mise en forme d'un texte. Nous créons une police avec la classe (QFont) en indiquant le nom de la police (MV Boli), la taille de la police (15) et le poids de la police (Bold). Nous modifions la taille d'une police avec la méthode (setPointSize).<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_bouton-connexion-invite" href="#gestion-des-utilisateurs">Bouton connexion invité</a>
</h2><br>Le bouton connexion invité (9) est utilisé en mode débogage pour permettre au développeur d'accéder directement au jeu sans saisir les identifiants de connexion. Dans ce mode, nous n'enregistrons pas le contexte de la session de jeu.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_bouton-nouvel-utilisateur" href="#gestion-des-utilisateurs">Bouton nouvel utilisateur</a>
</h2><br>L'action sur le bouton nouvel utilisateur (8) ouvre une boîte de dialogue dans laquelle nous pouvons enregistrer un nouvel utilisateur.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_boite-de-dialogue--saisie-d-un-nouvel-utilisateur-" href="#gestion-des-utilisateurs">Boîte de dialogue (saisie d'un nouvel utilisateur)</a>
</h2><br>Une boîte de dialogue est une fenêtre modale de niveau supérieure qui désactive l'interaction de l'utilisateur avec la fenêtre principale. Nous créons la boîte de dialogue en créant une classe qui dérive de la classe (QDialog). Nous initialisons le titre de la boîte de dialogue avec la méthode (setWindowTitle). Nous fixons les dimensions minimales de la boîte de dialogue avec la méthode (setMinimumSize). Nous fixons les dimensions maximales de la boîte de dialogue avec la méthode (setMaximumSize).<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_qt-designer" href="#gestion-des-utilisateurs">Qt Designer</a>
</h2><br>Qt Designer est un éditeur d'interfaces graphiques fourni par Qt. Il permet de créer des interfaces graphiques par simple glisser-déposer. D'ailleurs, nous avons utilisé Qt Designer pour concevoir l'interface graphique de la saisie d'un nouvel utilisateur.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_nom-de-l-objet" href="#gestion-des-utilisateurs">Nom de l'objet</a>
</h2><br>Le nom de l'objet est défini par la méthode (setObjectName) de la classe (QObject). Le nom de l'objet permet de modifier la mise en forme d'un objet à partir de la feuille de styles (QSS) gérée par Qt. La syntaxe QSS est l'équivalent Qt de la syntaxe CSS côté HTML.&nbsp;La classe (QObject) est la mère de toutes les classes qui veulent bénéficier de la mise en forme QSS fourni par Qt.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_expression-reguliere" href="#gestion-des-utilisateurs">Expression régulière</a>
</h2><br>Une expression régulière permet d'établir un modèle de correspondance dans un texte. Nous utilisons une expression pour vérifier par exemple que le nom d'utilisateur correspond à une adresse email valide ou que le mot de passe correspond à un mot passe valide. Nous créons une expression régulière avec la classe (QRegularExpression). Nous créons un vérificateur de correspondance d'une expression régulière avec la classe (QRegularExpressionMatch). Nous récupérons le résultat de la correspondance avec la méthode (hasMatch) de la classe (QRegularExpressionMatch).
<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_expression-reguliere" href="#gestion-des-utilisateurs">Expression régulière</a>
</h2><br>Une expression régulière permet d'établir un modèle de correspondance dans un texte. Nous utilisons une expression pour vérifier par exemple que le nom d'utilisateur correspond à une adresse email valide ou que le mot de passe correspond à un mot passe valide. Nous créons une expression régulière avec la classe (QRegularExpression). Nous créons un vérificateur de correspondance d'une expression régulière avec la classe (QRegularExpressionMatch). Nous récupérons le résultat de la correspondance avec la méthode (hasMatch) de la classe (QRegularExpressionMatch).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-utilisateurs_base-de-donnees" href="#gestion-des-utilisateurs">Base de données</a>
</h2><br>Une base de données permet de stocker des données de manière permanente. Nous utilisons la base de données pour sauvegarder par exemple les données de chaque utilisateur ainsi que le contexte de chaque session de jeu.&nbsp;<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="base-de-donnees">Base de données</a>
</h1>
<div class="Section6"><br>Une base de données permet de stocker des données de manière permanente. Nous utilisons la base de données pour sauvegarder par exemple les données de chaque utilisateur ainsi que le contexte de chaque session de jeu.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_base-donnees-mysql">Base données MySQL</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_connexion-a-la-base-donnees">Connexion à la base données</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_gestionnaire-de-requetes-sql">Gestionnaire de requêtes SQL</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_injection-sql">Injection SQL</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_requetes-sql-preparees">Requêtes SQL préparées</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_requetes-sql-d-insertion">Requêtes SQL d'insertion</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#base-de-donnees_requetes-sql-de-selection">Requêtes SQL de sélection</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_base-donnees-mysql" href="#base-de-donnees">Base données MySQL</a>
</h2><br>MySQL est un système de gestion de base de données relationnelles. MySQL est pris en charge par Qt.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_connexion-a-la-base-donnees" href="#base-de-donnees">Connexion à la base données</a>
</h2><br>Nous créons une nouvelle connexion (QSqlDatabase) avec la méthode statique (addDatabase) de la classe (QSqlDatabase) en indiquant le nom du driver (QMYSQL) et un nom de la connexion (rdv_super_mario_bros). Nous initialisons l'adresse du serveur de données avec la méthode (setHostName) de la classe (QSqlDatabase). Nous initialisons le numéro de port du serveur de données avec la méthode (setPort) de la classe (QSqlDatabase). Nous initialisons le nom d'utilisateur du serveur de données avec la méthode (setUserName) de la classe (QSqlDatabase). Nous initialisons le mot de passe du serveur de données avec la méthode (setPassword) de la classe (QSqlDatabase). Nous initialisons le nom de la base de données à utiliser sur le serveur de données avec la méthode (setDatabaseName) de la classe (QSqlDatabase). Nous ouvrons la connexion au serveur de données avec la méthode (open) de la classe (QSqlDatabase).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_gestionnaire-de-requetes-sql" href="#base-de-donnees">Gestionnaire de requêtes SQL</a>
</h2><br>Nous créons un gestionnaire de requêtes SQL avec la classe (QSqlQuery) en indiquant au constructeur la connexion (QSqlDatabase).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_injection-sql" href="#base-de-donnees">Injection SQL</a>
</h2><br>Une injection SQL est une attaque SQL consistant à détourner le fonctionnant d'une requête SQL dans le but de se connecter à un système sans avoir l'autorisation. L'injection SQL est réalisée en injectant une requête de détournement SQL à base l'opérateur logique OR dans les champs nom d'utilisateur ou mot de passe.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_requetes-sql-preparees" href="#base-de-donnees">Requêtes SQL préparées</a>
</h2><br>Les requêtes SQL préparées sont le moyen le plus sûr de lutter contre les attaques par injection SQL. La préparation des requêtes SQL est une étape obligatoire dans la construction d'un système de sécurisé. Nous préparons nos requêtes SQL avec la méthode (prepare) de la classe (QSqlQuery). Nous lions les données à la requête SQL préparée avec la méthode (bindValue) de la classe (QSqlQuery). Nous exécutons la requête SQL avec la méthode (exec) de la classe (QSqlQuery).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_requetes-sql-d-insertion" href="#base-de-donnees">Requêtes SQL d'insertion</a>
</h2><br>Nous récupérons l'ID de la dernière insertion avec la méthode (lastInsertId) de la classe (QSqlQuery).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="base-de-donnees_requetes-sql-de-selection" href="#base-de-donnees">Requêtes SQL de sélection</a>
</h2><br>Nous récupérons le gestionnaire des enregistrements (QSqlRecord) avec la méthode (record) de la classe (QSqlQuery). Nous récupérons le nombre de lignes d'enregistrements avec la méthode (size) de la classe (QSqlQuery). Nous récupérons le nombre de colonnes de chaque enregistrement avec la méthode (count) de la classe (QSqlRecord). Nous parcourons les enregistrements avec la méthode (next) de la classe (QSqlQuery). Nous récupérons la valeur de chaque colonne de l'enregistrement en cours avec la méthode (value) de la classe (QSqlQuery) en indiquant l'index de la colonne (iCol).
<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="gestion-des-effets-sonores-et-des-audio">Gestion des effets sonores et des audio</a>
</h1>
<div class="Section6"><br>Les effets sonores ajoutent une profondeur empathique et psychologique à notre jeu en accompagnant les actions, les moments forts, l'atmosphère et les personnages du jeu. L'application démarre par exemple avec un audio du jeu de Super Mario Bros. Des effets sonores différentes sont par exemple associés aux moments où le personnage de Super Mario Bros acquiert un pouvoir et grandit ou perd un pouvoir et rétrécit. Cela rend le jeu reconnaissable à travers les effets sonores et les audios qui l'accompagnent sans avoir vu l'interface du jeu.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-effets-sonores-et-des-audio_patron-observateur">Patron observateur</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-effets-sonores-et-des-audio_communication-inter-objets">Communication inter-objets</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-effets-sonores-et-des-audio_gestion-des-effets-sonores">Gestion des effets sonores</a>
</div>
<div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
<a class="Summary6" href="#gestion-des-effets-sonores-et-des-audio_gestion-des-audios">Gestion des audios</a>
</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-effets-sonores-et-des-audio_patron-observateur" href="#gestion-des-effets-sonores-et-des-audio">Patron observateur</a>
</h2><br>Le mécanisme des signaux et des slots, fourni par Qt est une implémentation très bien élaborée du patron observateur. Ce mécanisme permet de notifier un objet lorsqu'un changement d'état intervient dans un autre objet. Cela favorise l'élimination de couplage fort entre les objets.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-effets-sonores-et-des-audio_communication-inter-objets" href="#gestion-des-effets-sonores-et-des-audio">Communication inter-objets</a>
</h2><br>Nous connectons l'émetteur au récepteur avec la méthode (connect) de la classe (QObject) en indiquant le signal émis par l'émetteur (customSignal) et le slot reçu par le récepteur (customSlot). L'objet émetteur émet un signal (customSignal) avec le mot clé (emit) et l'objet récepteur capture le signal avec le slot (customSlot). La classe (QObject) est la mère de toutes les classes qui veulent bénéficier du mécanisme des signaux et des slots, fourni par Qt.<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-effets-sonores-et-des-audio_gestion-des-effets-sonores" href="#gestion-des-effets-sonores-et-des-audio">Gestion des effets sonores</a>
</h2><br>Nous créons un gestionnaire d'effet sonore avec la classe (QSoundEffect). Nous initialisons le chemin de l'effet sonore avec la méthode (setSource). Nous indiquons de jouer l'effet sonore en une seule fois avec la méthode (setLoopCount) en indiquant 0 ou 1 comme nombre de boucle. Nous initialisons le volume en pourcentage avec la méthode (setVolume). Nous jouons l'effet sonore avec la méthode (play).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="gestion-des-effets-sonores-et-des-audio_gestion-des-audios" href="#gestion-des-effets-sonores-et-des-audio">Gestion des audios</a>
</h2><br>Nous créons un gestionnaire de son audio avec la classe (QMediaPlayer). Nous initialisons le chemin du son audio avec la méthode (setSource). Nous initialisons la sortie audio avec la méthode (setAudioOutput). Nous jouons le son audio avec la méthode (play). Nous arrêtons le son audio avec la méthode (stop). Nous créons un gestionnaire de sortie audio avec la classe (QAudioOutput).
<br><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
